import ReactDOM from 'react-dom';
import './index.css';
import {add,sub,mul,div} from './Calc';
import App from './App';

function Card (props){
    return (
        <>
        <div className='cards'>
        <div className='card'>
        <img src="https://hbomax-images.warnermediacdn.com/images/GYJ2n2AJJG8JnLQEAAAHr/tileburnedin?size=1280x720&partner=hbomaxcom&v=4b4d382824e9e212a2cc64c5837b9119&host=art-gallery.api.hbo.com&language=en-us&w=1280" alt="mypic" className='card_img'/>
        <div className='card_info'>
          <span className='card_category'>A Netflix series</span>
          <h3 className='card_title' >GRIZZY AND THE LEMMINGS</h3>
     <a href="https://www.netflix.com/in/title/81154166" target="_blank">
     <button>
          Watch Now
     </button>
     </a>
        </div>


        </div>


        </div>
   </>
    )
 }


ReactDOM.render(
 <>
   <Card imgsrc="https://hbomax-images.warnermediacdn.com/images/GYJ2n2AJJG8JnLQEAAAHr/tileburnedin?size=1280x720&partner=hbomaxcom&v=4b4d382824e9e212a2cc64c5837b9119&host=art-gallery.api.hbo.com&language=en-us&w=1280" 
    title="A Netflix series"
    sname="GRIZZY AND THE LEMMINGS"
    link="https://www.netflix.com/in/title/81154166"
   />
   <Card />

 </>,
